function Rightpart(){

  return (
    <Box
      d={{  md: "flex" }}
      alignItems="center"
      flexDir="column"
      p={3}
      bg="white"
      w={{ base: "100%", md: "68%" }}
      borderRadius="lg"
      borderWidth="1px"
    >
      C
    </Box>
  );
}

export default Rightpart;
